import styled from "styled-components";
import { Twitter } from "@styled-icons/boxicons-logos/Twitter";

const Container = styled.div`
    margin: 0;
    min-width: 250px;
    border: solid 1px black;
`;

const Logo = styled(Twitter)`
    color: #00aaee;
    width: 45px;
    height: 45px;
`;

const Nav = styled.ul``;

export default function Sidebar() {
    return (
        <Container>
            <Logo />
            <Nav>Hello</Nav>

        </Container>
    );
}
